import React from 'react';

function Logo() {
  return (
    <div className="logo">
      Car Care
      <style>
        {`
          img.wp-smiley,
          img.emoji {
            display: inline !important;
            border: none !important;
            box-shadow: none !important;
            height: 1em !important;
            width: 1em !important;
            margin: 0 0.07em !important;
            vertical-align: -0.1em !important;
            background: none !important;
            padding: 0 !important;
          }
        `}
      </style>
    </div>
  );
}

export default Logo;
